contracts/notbitcoin.sol.content:
pragma solidity >= 0.7.0 <0.9.0;

contract notbitcoin {

    int public Profit;

    constructor(int userImput) {
        Profit = userImput;
    }

    function viewProfits() public view returns (int){
      return Profit;
  }

    function buy() public {
        Profit += 1;
    }


    function refund() public {

        Profit -= 1;
    }

      function discountUp() public {
        Profit *= 15 ;
    }
}

